// SharedComponents.js
import React from "react";
import { Link, useNavigate } from "react-router-dom";

// Navbar Component
export const Navbar = ({ isDarkMode, toggleDarkMode, isLoggedIn }) => {
  const navigate = useNavigate();

  const handleAuthButton = () => {
    if (isLoggedIn) {
      navigate("/"); // logout redirects to home
    } else {
      navigate("/login");
    }
  };

  return (
    <nav style={{ /* same navbar styles */ }}>
      <h2>Aptitude Preparation</h2>
      <div>
        <button>Free Trial</button>
        <button onClick={handleAuthButton}>{isLoggedIn ? "Logout" : "Login"}</button>
        <button onClick={toggleDarkMode}>{isDarkMode ? "Light Mode" : "Dark Mode"}</button>
      </div>
    </nav>
  );
};

// Footer Component
export const Footer = () => {
  return (
    <footer style={{ /* footer styles */ }}>
      © {new Date().getFullYear()} Aptitude Preparation | Designed with ❤️ by Shamal
    </footer>
  );
};
